function Card(card, {handleClick}) {

    function handleClick () {
       onCardClick(card)
      }  

  return (
                <div className="element">
                    <img className="element__image" src={card.link} alt={card.name} onClick={card.handleClick}/>
                    <div className="element__item">
                        <p className="element__title" name="name">{card.name}</p>
                        <button className="element__delete"></button>
                        <div className="element__likes-and-number">
                            <button className="element__like"></button>
                            <p className="element__like-number">{card.like}</p>
                        </div>
                    </div>
                </div>
  )
}

export default Card;
